import React from "react";
import Layout from "../assets/Layout";

export default class Index extends React.Component {
    render() {
        return (
            <Layout>
                <h1 style={{ color: "#ff5555" }}>Nonexistent</h1>
                <h2>You seem mistaken traveler. That page is nowhere to be found.</h2>
            </Layout>
        )
    }
}
